import React from 'react'
import "./Service.scss"

function Servicesection() {
    const services = [
        {
            image: "../../images/icons/s01.png", title: "Organic Search (SEO)", desc: "Stop selling. Start helping. Utilize SEO to capture early stage awareness queries through relevant content", num: "01"
        }
    ]

    return (
        <>
            <div className='container py-5'>
                <div className="service-container">
                <img src={"../../images/about/01.png"} alt="" style={{height:"210px",width:"200px"}}/>

                    {services.map((data, index) => (
                        <div className="single-service" key={index}>
                            <img src={data.image} alt="" style={{height:"210px",width:"200px"}}/>
                            {data.image}
                        </div>
                    ))}

                </div>

            </div>
        </>
    )
}

export default Servicesection
